import React from 'react'
import Admin from './pages/Admin'
import {Browsersatck as Router, Routes, Route} from "react-router-dom"
function App() {
  return (
    <Router>
      <Routes>
        <Route path='/admin' Component={<Admin/>} />
      </Routes>
    </Router>
  )
}

export default App
